import React from 'react';
import {Text, View, Button, StyleSheet} from 'react-native';

function AnnouncementScreen() {
    return (
        <View style={styles.Text}>
        <Text>Announcement</Text>
      </View>
    );
};

export default AnnouncementScreen;
